                    "@php php-cs-fixer.phar self-update",
                    "@php php-cs-fixer.phar fix --diff -v --allow-risky=yes --ansi",
                    "@php php-cs-fixer.phar fix --config=lib/generator/.php_cs.dist --diff -v --allow-risky=yes --ansi"
