                    "@php php-cs-fixer.phar fix --config=lib/generator/.php_cs.dist --dry-run --diff -v --allow-risky=yes --ansi"
                ],
                "code-quality": [
                    "rm composer.lock",
                    "@composer install --ansi",
                    "@static-analysis",
                    "@bench",
                    "@check-cs"
                ],
